import React from "react";

function Note(props){
    
    function deleteitem(){
        props.ondelete(props.id);
    }
    return (
        <div>
            <div className="note">
            <h3>{props.title}</h3>
            <p>{props.content}</p>
            <button className="btn" onClick={deleteitem}>Delete</button>
            </div>
        </div>
    )
}

export default Note;
